import React from 'react';
import google from 'styled-components';

interface LoginGButtonProps {
  label: string;
}

const GoogleButton = google.button`
  background-color: #ea4335;
  color: white;
  padding: 10px 20px;
  border: 1px solid black;
  cursor: pointer;
  font-size: 16px;
  width: 85%;
  margin-top: 15px;

  font-family: open sans;

  height: 54px;
    padding-left: 30px;
    padding-right: 30px;

  &:hover {
    background-color: black;
  }

`;

const LoginGButton: React.FC<LoginGButtonProps> = ({ label }) => {
  return <GoogleButton type="submit">{label}</ GoogleButton>;
};

export default LoginGButton;
